export default function TodoApp() {
    return (
        <div className="TodoApp">
            <LoginComponent />
            {/* <WelcomeComponent /> */}
        </div>
    )
}

function LoginComponent() {
    return (
        <div className="Login">
            <div className="LoginForm">
                <div>
                    <label style={{
            margin:"10px",
            padding:"10px"
        }}>Username:</label>
                    <input type="text" name="username" style={{
            margin:"10px",
            padding:"10px"
        }}/>
                </div>
                <div>
                    <label style={{
            margin:"10px",
            padding:"10px"
        }}>Password:</label>
                    <input type="password" name="password" style={{
            margin:"10px",
            padding:"10px"
        }}/>
                </div>
                <div>
                    <button type="button" name="login" style={{
            margin:"10px",
            padding:"10px"
        }}>login</button>
                </div>
            </div>
        </div>
    )
}

function WelcomeComponent() {
    return (
        <div className="Welcome">
            Welcome Component
        </div>
    )
}
